            return getSMEFTCoeffEW("CHl1R", 0, 0);
        case 2:
            return getSMEFTCoeffEW("CHl1R", 1, 1);
        case 3:
            return getSMEFTCoeffEW("CHl1R", 1, 1);
        case 4:
            return getSMEFTCoeffEW("CHl1R", 2, 2);
        case 5:
