            break;
    //else if (p.is("TAU"))
        case 5:
            CHF = getSMEFTCoeff("CHl1R", 2, 2, mu) + getSMEFTCoeff("CHl3R", 2, 2, mu);
            break;
    //else if (p.is("UP"))
        case 6:
            CHF = getSMEFTCoeff("CHq1R", 0, 0, mu) - getSMEFTCoeff("CHq3R", 0, 0, mu);
