    dwidth += cLHd6 * (C1 + 2.0 * dZH1) * deltaG_hhhRatio();
    //  Quadratic contribution from Higgs self-coupling: add separately from FlagQuadraticTerms
    dwidth += cLHd6 * cLH3d62 * dZH2 * deltaG_hhhRatio() * deltaG_hhhRatio();

